import React from "react";
import { CircularProgressbar, buildStyles } from "react-circular-progressbar";

const Skills = () => {
  const html = 66;

  return (
    <div className="skills container-fluid">
      <div className="col-md-6 container techniclal">
        <div className="row">
          <h3 className="col">Technical skills</h3>
          <CircularProgressbar
              value={html}
              text={`html%`}
              styles={buildStyles({
                rotation: 0.25,
                strokeLinecap: "butt",
                textSize: "16px",
                pathTransitionDuration: 0.5,
                pathColor: `rgba(62, 152, 199, ${html / 100})`,
                textColor: "#f88",
                trailColor: "#d6d6d6",
                backgroundColor: "#3e98c7"
              })}
            />
        </div>
        <div className="row">
          <div className="circle container">
            <CircularProgressbar
              value={html}
              text={`html%`}
              styles={buildStyles({
                rotation: 0.25,
                strokeLinecap: "butt",
                textSize: "16px",
                pathTransitionDuration: 0.5,
                pathColor: `rgba(62, 152, 199, ${html / 100})`,
                textColor: "#f88",
                trailColor: "#d6d6d6",
                backgroundColor: "#3e98c7"
              })}
            />
          </div>
        </div>
      </div>

      <div className="col-md-6 container soft">
        <h3>soft skills</h3>
      </div>
    </div>
  );
};
export default Skills;
